$(function(){
  rebind_lightbox();
});
function rebind_lightbox(){
 $.extend(true, $.magnificPopup.defaults, {
    enableEscapeKey: true
  });
  $('.modal-image').magnificPopup({
    type: 'image',
    mainClass: 'mfp-slide-bottom',
    callbacks: {
      beforeOpen: function() {  this.wrap.removeAttr('tabindex') }
    }
  });
  $(".modal-close,.modal-close-noaction").click(function(){
    $.magnificPopup.close();
  });
  $(".modal-close-noanchor").click(function(){
    $.magnificPopup.close();
	return false;
  });
  $(".modal-iframe").click(function(){
    $.magnificPopup.close();
    $.magnificPopup.open({
      type: 'iframe',
      mainClass: 'mfp-slide-bottom',
      items: {src: $(this).attr("href")}
    });
	return false;
  });
  $(".modal-ajax-submit").submit(function(){
    $.magnificPopup.open({
      type: 'inline',
      mainClass: 'mfp-slide-bottom',
      items: {src: "#"+$(this).attr("data-returnwindow")}
    });
  })
  $(".modal-ajax,.modal-open,.modal-openaction,.modal-openaction-asis").click(function(e){
	e.preventDefault();
	if(typeof $(this).attr("data-modalopen") != "undefined" && $(this).attr("data-modalopen") != ""){
      var modalid = '#'+$(this).attr("data-modalopen");
	}else if(typeof $(this).attr("data-modal") != "undefined" && $(this).attr("data-modal") != ""){
      var modalid = '#'+$(this).attr("data-modal");
	}else if(typeof $(this).attr("href") != "undefined" && $(this).attr("href") != "" && $(this).attr("href") != "#"){
	  var modalid = $(this).attr("href");
	}else if(typeof $(this).attr("id") != "undefined" && $(this).attr("id") != ""){
	  var modalid = '#view-'+$(this).attr("id");
	}
    setTimeout(function(){$.magnificPopup.open({
      type: 'inline',
	  fixedContentPos: false,
      mainClass: 'mfp-slide-bottom',
	  callbacks: {
		open: function() {
		  $('body').css('overflow-y','hidden');
		},
		close: function() {
		  $('body').css('overflow-y','auto');
		}
	  },
      items: {src: modalid}
    });setTimeout(function(){
      $(".mfp-container").animate({ scrollTop: 0 },0);
	},500)},10);
   setTimeout(function(){$(modalid+' *:input,select,textarea').filter(":visible:enabled:not(input[type=checkbox],button,input[type=button],input[type=submit],.form-datepicker,.form-datepicker-editable,.form-timepicker,[data-filter='true']):first").focus()},300)
  });
  $(".modal-open-fixed").click(function(e){
	e.preventDefault();
	if(typeof $(this).attr("data-modalopen") != "undefined" && $(this).attr("data-modalopen") != ""){
      var modalid = '#'+$(this).attr("data-modalopen");
	}else if(typeof $(this).attr("data-modal") != "undefined" && $(this).attr("data-modal") != ""){
      var modalid = '#'+$(this).attr("data-modal");
	}else if(typeof $(this).attr("href") != "undefined" && $(this).attr("href") != "" && $(this).attr("href") != "#"){
	  var modalid = $(this).attr("href");
	}else if(typeof $(this).attr("id") != "undefined" && $(this).attr("id") != ""){
	  var modalid = '#view-'+$(this).attr("id");
	}
    setTimeout(function(){$.magnificPopup.open({
      type  : 'inline',
      mainClass: 'mfp-slide-bottom',
	  closeOnBgClick: false,
	  showCloseBtn: false,
	  enableEscapeKey: false,
      items: {src: modalid}
    })},10);
   setTimeout(function(){$(modalid+' *:input,select,textarea').filter(":visible:enabled:not(input[type=checkbox],button,input[type=button],input[type=submit],.form-datepicker,.form-datepicker-editable,.form-timepicker,[data-filter='true']):first").focus()},300)
  });
}
function pl_closemodal(){
  $.magnificPopup.close();	
}
