$(function(){
  reBind_datetime();
});

function reBind_datetime(){
  $('.form-datepicker-editable:not(.picker__input)').pickadate({format: 'mmmm d, yyyy', editable: true})
  $('.form-datepicker:not(.picker__input)').pickadate({format: 'mmmm d, yyyy'})
  $('.form-datepicker-short:not(.picker__input)').pickadate({format: 'mm/d/yy'});
  $('.form-datepicker-short-editable:not(.picker__input)').pickadate({format: 'mm/d/yy', editable: true})
  $('.form-timepicker:not(.picker__input)').timepicker();
  $('.queue-datepicker:not(.picker__input)').pickadate({
	  format: 'mmmm d, yyyy',
      min: true,
      max: false
  });
}

